import "./App.css";
import { useEffect, useState } from "react";
import { getNewStoryIds } from "./APICalls/getApiStories";

const App = () => {
  const [newStories, setnewStories] = useState();

  useEffect(() => {
    setnewStories(getNewStoryIds());
    console.log(newStories);
  });
  return <div></div>;
};

export default App;
